        while (i < n && isdigit(s[i])) {
            i++;
            hasDigits = true;
        }

        // Check optional decimal point and digits after it
        if (i < n && s[i] == '.') {
            i++;
            while (i < n && isdigit(s[i])) {
                i++;
                hasDigits = true;
            }
        }

        // Check optional exponent part
